import React from 'react'
import InfoLogin from './InfoLogin'
import CuerpoFeed from '../components/CuerpoFeed'

class LoadClips extends InfoLogin {
    
render(){
    console.log(this.state.clips+'Hi');
    return (
            <div className="container">
                <div className="row mt-2 justify-content-center">

                     <CuerpoFeed clipX={this.state.clips} />
                     
                </div>
            </div>
    
    )
}
}
export default LoadClips
